import React, { useState } from "react";

function App() {
  const [likes, setLikes] = useState();
  return (
    <div className="App">
      <h1>{likes}</h1>
      <button onClick={() => likes--}>-</button>
      <button onClick={() => likes++}>+</button>
    </div>
  );
}

export default App;
